import React from 'react';
import {
  BrowserRouter as Router, Route, Switch
} from "react-router-dom";
import './App.css';
import Login from './modules/Login';

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/">
          <Login></Login>
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
